import React from "react";
import api from "../../api";

const UserPage = () => {
  const [users, setUsers] = useState(
    api.users.getById("67rdca3eeb7f6fgeed47181f")
  );

  console.log(users);
  return (
    <h1>
      {api.users.getById("67rdca3eeb7f6fgeed47181f").then((data) => data.name)}
    </h1>
  );
};

export default UserPage;
